script: |
  super -f text -I q4133.spq | sort > q4133.out

inputs:
  - name: q4133.spq
    data: |
      SELECT col2 - + col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE cor0.col0 NOT IN ( + col2 * + col0 + - col1 * col0 );
  - name: tab1

outputs:
  - name: q4133.out
    data: |
      28
      47
      83
